import React from "react";
import SocialItem from "./SocialItem";


function Social () {
    return(
        <ul className="list-group">

            <SocialItem 
            media = 'Facebook'
            id = 'Facebook'/>
            
            <SocialItem 
            media = 'Instagram' 
            id = 'Instagram'/>

            <SocialItem 
            media = 'Snapchat' 
            id = 'Snapchat'/>
            
        </ul>
    )
}

export default Social ;
